const day4part1 = input => {
  return input.split("\n")
              .map(line => line.split(" "))
              .map(words => words.length == (new Set(words)).size ? 1 : 0)
              .reduce((a, b) => a + b);
}

const day4part2 = input => {
  return input.split("\n")
              .map(line => line.split(" "))
              .map(words => words.map(word => word.split("").sort().join("")))
              .map(words => words.length == (new Set(words)).size ? 1 : 0)
              .reduce((a, b) => a + b);
}

